import './Feed.css';

function Feed() {


    return (
        <div className="feed">
            {/* Header */}
            <div className="feed__header">
                <h1>Home</h1>
            </div>

            {/* Posts */}
            <PostBox />

            {posts.map((post) => (
                <Post
                    name={post.name}
                    text={post.text}
                    avatar={post.avatar}
                    image={post.image}
                />
            ))}

        </div>
    );
}

export default Feed;
